import logo from './logo.svg';
import './App.css';


function App() {
  return (
    <main>
      <h2>Tyson's react</h2>
      <Router >
        <Navbar />
          <Routes>
            <Route path="/" />
            <Route path="/products" element={<Products />} />
            <Route path="/contact" element={<Contact />} />
          </Routes>
      </Router>
  </main>
  );
}

export default App;
